						"TitoloTrattamento": "Anamnesi",
						"TestoTrattamento": "{\"AnamnesiMotivo\":\"Storia clinica:\\n\\n-Sintomi attuali:\\n\\nIl paziente ha riportato sintomi di lombosciatalgia, inclusi dolore lancinante nella zona lombare e formicolio lungo la gamba destra.\\nI sintomi sono iniziati circa 6 settimane fa.\\n\\n- Eventi scatenanti:\\n\\nIl paziente ha segnalato un sollevamento improprio di oggetti pesanti come possibile causa dei sintomi.\\n\\n-Storia medica:\\n\\nIl paziente ha riportato problemi spinali preesistenti, come una lieve ernia del disco nella zona lombare.\\nHa ricevuto trattamenti chiropratici nel passato per gestire i sintomi.\\n\\n- Farmaci e integratori:\\n\\nIl paziente sta attualmente assumendo ibuprofene per alleviare il dolore.\\n\\n- Storia chirurgica:\\n\\nIl paziente non ha subito interventi chirurgici alla schiena o alla zona lombare in passato.\\n\\n- Allergie e intolleranze:\\n\\nIl paziente ha dichiarato di essere allergico alla penicillina.\\n\\n>Stile di vita e fattori di rischio:\\n\\n- AttivitÃ  fisica:\\n\\nIl paziente ha descritto il suo livello di attivitÃ  fisica come moderato, con passeggiate regolari.\\n\\n- Postura e abitudini quotidiane:\\n\\nIl paziente lavora principalmente al computer ed Ã¨ consapevole di avere una postura non ottimale durante il lavoro.\\n\\n- Stress e fattori psicologici:\\n\\nIl paziente ha menzionato livelli di stress legati al lavoro che potrebbero influire sulla lombosciatalgia.\\n\\n- Obiettivi di trattamento:\\n\\nIl paziente ha espresso il desiderio di ridurre il dolore nella zona lombare e migliorare la mobilitÃ .\\n\\n- Note aggiuntive:\\n\\nDurante la consultazione, il paziente ha sottolineato l'importanza di trovare un trattamento che abbia un approccio piÃ¹ naturale rispetto all'assunzione di farmaci a lungo termine.\\n\",\"AnamnesiDiagnosiOccidentale\":\"Il CLIENTE DEMO IAOMAI presenta una condizione di lombosciatalgia, caratterizzata da dolore nella zona lombare e formicolio lungo il decorso del nervo sciatico. La condizione sembra essere correlata a una possibile irritazione del nervo sciatico, probabilmente scatenata da un sollevamento improprio e accentuata dalla presenza di un'ernia del disco lombare.\",\"AnamnesiDiagnosiMTC\":\"In base all'analisi dei sintomi e dei fattori di rischio, la lombosciatalgia di CLIENTE DEMO IAOMAI potrebbe essere correlata a un'\\\"Ostruzione di Qi e Sangue nella Zona Lombare\\\" secondo i principi della Medicina Tradizionale Cinese. L'accumulo di stress, la postura non corretta e il sollevamento improprio potrebbero aver contribuito a questa condizione, ostacolando il flusso armonioso di Qi e Sangue lungo i meridiani della zona lombare.\\n\\nNell'ottica della MTC, l'obiettivo del trattamento sarÃ  quello di rimuovere l'ostacolo, promuovere la circolazione di Qi e Sangue e ristabilire l'equilibrio energetico nei meridiani coinvolti.\\n\"}",
